    const card = new Card({
      title: firstMatch.title,
      subtitle: firstMatch.description,
      media: new Media({
        type: 'image',
        url: `${firstMatch.image}`
      })
    })

    const message = new Message(`I found this one`)
    message.addResponse(card)
    message.addResponse(new Text('Is it the one you were looking for?'))

    // Send the first movie
    await state.save('movies', {
      data: data.results 
    })
    reply(message)

  } catch(err) {
    console.error(err)
    // This is not good..
    reply(new Message('I messed up. Could you try again?'))
  }
}

